INSERT INTO `Books` (`ISBN`, `Title`, `Author`, `Category`, `cover_img`, `Medium`, `Rating`, `Copies`, `Description`) VALUES
(1234, 'After', 'Anna Todd', 'CD/DVD', , 'English', 3.76, 5, 'After is a 2014 young adult romance novel written by American author Anna Todd and published by Gallery Books, an imprint of Simon & Schuster. After is the first installment of the After Series.A film adaptation of the same name was released on April 12, 2019.After was originally released as a fanfiction on Wattpad. Anna Todd\'s writing of the novel was inspired by the music and fandom of One Direction. She took inspiration from many of the alleged relationships Harry Styles, a member of One Direction, has been in. She was also inspired by many novel characters from her favourite classics and from other Wattpad books.');
INSERT INTO `Books` (`ISBN`, `Title`, `Author`, `Category`, `cover_img`, `Medium`, `Rating`, `Copies`, `Description`) VALUES
(1235, 'The Ballad of Songbirds and Snakes', 'Suzanne Collins', 'Book', , 'English', 3.82, 5, 'The Ballad of Songbirds and Snakes is a dystopian action-adventure novel by American author Suzanne Collins.It is a spinoff and a prequel to The Hunger Games trilogy.It is a spinoff and a prequel to The Hunger Games trilogy. It was released May 19, 2020, published by Scholastic.It is set against the backdrop of the 10th Hunger Games, The Ballad of Songbirds and Snakes revolves around the adventures of a teenage Coriolanus Snow, who would become the dictatorial president of the fictional nation of Panem by the events of the original trilogy. With his family on the brink of poverty, Coriolanus is tasked with mentoring District 12 tribute Lucy Gray Baird for his one shot at glory.');
INSERT INTO `Books` (`ISBN`, `Title`, `Author`, `Category`, `cover_img`, `Medium`, `Rating`, `Copies`, `Description`) VALUES
(1236, 'The Fault in Our Stars', ' John Green', 'Book/e-book', , 'English/German', 4.21, 5, 'The Fault in Our Stars is a novel by John Green. It is his fourth solo novel, and sixth novel overall.It was published on January 10, 2012. The title is inspired by Act 1, Scene 2 of Shakespeare\'s play Julius Caesar, in which the nobleman Cassius says to Brutus: \"The fault, dear Brutus, is not in our stars, But in ourselves, that we are underlings.\" The story is narrated by Hazel Grace Lancaster, a 16-year-old girl with thyroid cancer that has affected her lungs. Hazel is forced by her parents to attend a support group where she subsequently meets and falls in love with 17-year-old Augustus Waters, an ex-basketball player and amputee.');
INSERT INTO `Books` (`ISBN`, `Title`, `Author`, `Category`, `cover_img`, `Medium`, `Rating`, `Copies`, `Description`) VALUES
(1237, 'Untamed', 'Glennon Doyle', 'Book', , 'English', 4.15, 5, 'Untamed is a 2020 memoir by Glennon Doyle. It was published by The Dial Press on March 10, 2020.It is her third memoir.The book debuted at number one on The New York Times nonfiction best-seller list. where it stayed for seven weeks. As of May 31, 2020, the book has spent 10 weeks on the list');
INSERT INTO `Books` (`ISBN`, `Title`, `Author`, `Category`, `cover_img`, `Medium`, `Rating`, `Copies`, `Description`) VALUES
(1238, 'The Wonderful Wizard of Oz', 'L. Frank Baum', 'Book/e-Book', , 'English/German/French', 3.98, 5, 'The Wonderful Wizard of Oz is an American children\'s novel written by author L. Frank Baum. It has since seen several reprints, most often under the title The Wizard of Oz, which is the title of the popular 1902 Broadway musical adaptation as well as the iconic 1939 live-action film.The story chronicles the adventures of a young farm girl named Dorothy in the magical Land of Oz, after she and her pet dog Toto are swept away from their Kansas home by a cyclone. The book is one of the best-known stories in American literature and has been widely translated. The Library of Congress has declared it \"America\'s greatest and best-loved homegrown fairytale.\" Its groundbreaking success and the success of the Broadway musical adapted from the novel led Baum to write thirteen additional Oz books that serve as official sequels to the first story.');
INSERT INTO `Books` (`ISBN`, `Title`, `Author`, `Category`, `cover_img`, `Medium`, `Rating`, `Copies`, `Description`) VALUES
(1239, 'Jane Eyre', 'Charlotte Brontë', 'Book', , 'English', 4.13, 5, 'Jane Eyre is a novel by English writer Charlotte Brontë. Jane Eyre is a Bildungsroman which follows the experiences of its eponymous heroine, including her growth to adulthood and her love for Mr. Rochester, the brooding master of Thornfield Hall. The book contains elements of social criticism with a strong sense of Christian morality at its core, and it is considered by many to be ahead of its time because of Jane\'s individualistic character and how the novel approaches the topics of class, sexuality, religion, and feminism. It, along with Jane Austen\'s Pride and Prejudice, is one of the most famous romance novels of all time.');
INSERT INTO `Books` (`ISBN`, `Title`, `Author`, `Category`, `cover_img`, `Medium`, `Rating`, `Copies`, `Description`) VALUES
(1240, 'Diana: Her True Story in Her Own Words', 'Andrew Morton', 'Book', , 'English', 3.81, 3, 'Described by the Sunday Times (London) as the leading royal writer, Andrew Morton has become a household name as a result of the publication of Diana: Her True Story. This edition of Diana\'s life story includes recollections in her own words, as well as an account of the events surrounding her death, plus three 16-page photo inserts.When Diana: Her True Story was first published in 1992, it forever changed the way the public viewed the British monarchy. Greeted initially with disbelief and ridicule, the #1 New York Times bestselling biography has become a unique literary classic, not just because of its explosive contents but also because of Diana’s intimate involvement in the publication. Never before had a senior royal spoken in such a raw, unfiltered way about her unhappy marriage, her relationship with the Queen, her extraordinary life inside the House of Windsor, her hopes, her fears, and her dreams.');
INSERT INTO `Books` (`ISBN`, `Title`, `Author`, `Category`, `cover_img`, `Medium`, `Rating`, `Copies`, `Description`) VALUES
(1241, 'Oliver Twist', 'Charles Dickens', 'Book/e-book/CD/DVD', , 'English', 3.87, 4, 'Oliver Twist; or, the Parish Boy\'s Progress is Charles Dickens\'s second novel, and was published as a serial from 1837 to 1839 and released as a three-volume book in 1838, before the serialization ended. The story centres on orphan Oliver Twist, born in a workhouse and sold into apprenticeship with an undertaker. After escaping, Oliver travels to London, where he meets the \"Artful Dodger\", a member of a gang of juvenile pickpockets led by the elderly criminal Fagin. In this early example of the social novel, Dickens satirises the hypocrisies of his time, including child labour, domestic violence, the recruitment of children as criminals, and the presence of street children. The novel may have been inspired by the story of Robert Blincoe, an orphan whose account of working as a child labourer in a cotton mill was widely read in the 1830s. It is likely that Dickens\'s own experiences as a youth contributed as well.');
INSERT INTO `Books` (`ISBN`, `Title`, `Author`, `Category`, `cover_img`, `Medium`, `Rating`, `Copies`, `Description`) VALUES
(1246, 'A little Life', 'Hanya Yanagihara', 'Book', , 'English', 4.31, 2, 'A Little Life is a 2015 novel by American novelist Hanya Yanagihara. The novel was written over the course of eighteen months. Despite the length and difficult subject matter it became a bestseller.');
INSERT INTO `Books` (`ISBN`, `Title`, `Author`, `Category`, `cover_img`, `Medium`, `Rating`, `Copies`, `Description`) VALUES
(1250, 'Steve Jobs', 'Walter Isaacson', 'Book/e-Book', , 'English', 4.14, 3, 'Steve Jobs is the authorized self-titled biography of Steve Jobs. The book was written at the request of Jobs by Walter Isaacson, a former executive at CNN and TIME who has written best-selling biographies of Benjamin Franklin and Albert Einstei.');

