INSERT INTO `highlight` (`highlight_id`, `heading`, `content`, `content_body`, `content_body2`, `image`) VALUES
(1, 'Open access in Arts and Education', 'This session will explore opportunities and barriers to open access relevant to the Faculty of Arts and Education. It will consider: the benefits of open..', 'This session will explore opportunities and barriers to open access relevant to the Faculty of Arts and Education. It will consider: the benefits of open access, two pathways to open access: Green and Gold, making research open access at no cost in DRO, navigating open access publishing options, open access and NTROs (non-traditional research outputs).\r\n\r\nWe will also examine the current state of open access in arts, education and related disciplines, covering: the importance of open access for equity and inclusion, the ARC Open Access Policy, Plan S and other open access developments around the world.\r\n\r\nThe session is aimed at Raven researchers but open to all with an interest in the topic. It will comprise a 30-minute talk, followed by an opportunity for open discussion.', 'This training session will take place online via Zoom and will be recorded. You will receive a reminder with the link and password to the session one day before the training. This information is also included in the calendar invitation sent along with your confirmation email. If you cannot attend on the day, please feel free to register anyway and we\'ll send you a link to the recording after the session.\r\n\r\nRegistration is required. There are 138 seats available.', );
INSERT INTO `highlight` (`highlight_id`, `heading`, `content`, `content_body`, `content_body2`, `image`) VALUES
(2, 'Open access in Business and Law', 'This session will explore opportunities and barriers to open access relevant to the Faculty of Business and Law. It will consider: the benefits of open access..', 'During the lockdown, the Library has been open online to help you study, research and prepare for the new academic year. We will continue to offer these online services. As restrictions begin to ease, we’re now beginning to reopen our buildings in phases – with the health and wellbeing of our visitors and staff our top priority.\r\n\r\nStudy spaces at the Brotherton Library are available to book now, in addition to those at the Edward Boyle and Laidlaw Library. We will continue to increase the number of study spaces available across our buildings, open up additional buildings and extend our current opening hours, as part of a rolling programme through September.', 'Please limit your bookings to two sessions per week. Booking closes for the following day at 2pm. After 2pm, please look for the next available day. We will release the following week’s study slots on Wednesdays.\r\n\r\nWe will give you a desk number on arrival. Once inside the building, follow directional signage to find your seat. Study spaces are clearly numbered – you must stay at your allocated study space..\r\n\r\nPlease wear a facemask while entering and moving around inside the library - you can remove your mask while you study. Cleaning materials will be provided so that you can clean your study space at the start and end of your session.', );
INSERT INTO `highlight` (`highlight_id`, `heading`, `content`, `content_body`, `content_body2`, `image`) VALUES
(3, 'Open access in Science, Engineering and the Built Environment', 'This session will explore opportunities and barriers to open access relevant to the Faculty of Science, Engineering and the Built Environment. It will consider: the benefits of open..', 'The study skills needed at University can be very different from school or college, but with knowledge comes confidence.\r\n\r\nFlying Start covers all the essentials, from how to get the most from lectures and tutorials, time management, tackling your first assignment and the how and why of referencing.\r\n\r\nFeaturing videos and tips from Leeds students, Flying Start is a valuable source of practical advice on coping with the first year.', 'Get ahead with Flying Start\r\n\r\nLet us know which sessions you want to attend by filling in the online form. We’ll send you details on how to join the sessions nearer to the time.\r\n\r\nContact us to be kept up-to-date with the latest workshop information, including availability notifications and details of new sessions added to the schedule, you’ll also be entered into a prize draw with a £20 Love2Shop voucher to win.', );

