INSERT INTO `news` (`news_id`, `heading`, `content`, `news_body`, `news_body2`, `image`) VALUES
(1, 'New to University and not sure what to expect? Get ahead with Flying Start.', 'Our Research Centre has opened spaces for researchers in..', 'The study skills needed at University can be very different from school or college, but with knowledge comes confidence.  Flying Start covers all the essentials, from how to get the most from lectures and tutorials, time management, tackling your first assignment and the how and why of referencing.  Featuring videos and tips from Leeds students, Flying Start is a valuable source of practical advice on coping with the first year. Get ahead with Flying Start', 'Let us know which sessions you want to attend by filling in the online form. We’ll send you details on how to join the sessions nearer to the time.  Contact us to be kept up-to-date with the latest workshop information, including availability notifications and details of new sessions added to the schedule, you’ll also be entered into a prize draw with a £20 Love2Shop voucher to win.', ),
(2, 'Phased reopening of Library buildings', 'Study spaces are available to book now, alongside click and collect', 'During the lockdown, the Library has been open online to help you study, research and prepare for the new academic year. We will continue to offer these online services. As restrictions begin to ease, we’re now beginning to reopen our buildings in phases – with the health and wellbeing of our visitors and staff our top priority.  Study spaces at the Brotherton Library are available to book now, in addition to those at the Edward Boyle and Laidlaw Library. We will continue to increase the number of study spaces available across our buildings, open up additional buildings and extend our current opening hours, as part of a rolling programme through September.', 'Please limit your bookings to two sessions per week. Booking closes for the following day at 2pm. After 2pm, please look for the next available day. We will release the following week’s study slots on Wednesdays.  We will give you a desk number on arrival. Once inside the building, follow directional signage to find your seat. Study spaces are clearly numbered – you must stay at your allocated study space..  Please wear a facemask while entering and moving around inside the library - you can remove your mask while you study. Cleaning materials will be provided so that you can clean your study space at the start and end of your session.', ),
(3, 'Special Collections re-opens for researchers', 'Our Research Centre has opened spaces for researchers in ', 'Our Research Centre has opened spaces for four researchers in the Brotherton room – alongside virtual consultations and no-charge photos on request.  Special Collections is now open to researchers, with sessions running from 10am to 1pm and 2pm to 4pm, Monday to Thursday. Due to the limited capacity, we will prioritise researchers from the University of Leeds.  Book your space and request the items you wish to consult using our new online “visitor basket” while browsing our collections.  The new online booking and request system allows you to choose materials as you search our collections and then book a preferred date to visit. We’ll then contact you to confirm your visit date. You can find guidance on using the new online booking system in our Plan a visit webpages.', 'If you’re not able to visit in person, we are offering virtual consultations for researchers to quickly access materials. We’ll show the items live using Microsoft Teams for up to an hour per session. Contact us to arrange a consultation.  You are also able to request mobile phone quality photos of material for individual research at no charge. We can photograph materials for up to an hour at a time. Contact us to request photos. If the material is too fragile or large to photograph safely, we will let you know so you can request high-quality images through our Digitisation Service. Charges will apply for digitisation.', );

